  [],\n\t\"revision_timestamp\": \"2015-05-07T01:00:21.924797\",\n\t\"name\": \"analysis-and-development-of-uav-operations-in-the-nas-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Aurora Flight Sciences, in collaboration
  with Air Network Simulation and Analysis, Inc. (ANSA), proposes to develop a simulation-based
  methodology to analyze and guide the development of Unmanned Aerial Vehicle (UAV)
  operations in the National Airspace System (NAS).The key technical accomplishment
  of the Phase I effort will be the integration of Aurora's 4D Path Planner with ANSA's
  stochastic NAS simulation.  Within this framework, the path planner generates trajectories
  inside a single ARTCC of interest, and is supported by a coarser ANSA model of the
  remaining NAS.Simulation requirements will be developed for civil aircraft routing
  and planning in dynamic, stochastic environments, and will include realistic performance
  models for both manned and unmanned vehicles.  The initial, proof-of-concept simulation
  environments will be comprised of exactly one ARTCC and one Terminal Area.  Aurora
  will use this simulation to conduct a Capacity Impact Study during the Phase I effort.
  \ A major focus of the study will be a parametric analysis in which the effects
  from varying the UAV separation standards, flight performance, quantity relative
  to manned aircraft, and total operations growth on NAS performance will be simulated.
